import { createRouter,createWebHistory} from 'vue-router'
import ListPelfVue from '@/components/view/pelf/ListPelf.vue';
const routes = [
  {   path: "/ ListPelfVue",name: "ListPelfVue",component: ListPelfVue}, 
  ]
  const router = createRouter({
    history:createWebHistory() ,
    routes,
  })
  export default router;
